import React from 'react';
import Tabs from "../tab-forms/tab";
import styled from "styled-components";
import Form from "../tab-forms/booking-form";

const ContainerWrapper = styled("div")`
position:absolute;
top:0px;
margin: 20px;
`;

const Container = () => {
    return (
        <ContainerWrapper>
            <Tabs>
                <Form/>
            </Tabs>
        </ContainerWrapper>
    );
}

export default Container;
